  return (
    <Grommet>

        <Box direction="row-responsive" justify="start" height="100%" align="baseline" border='all' >
          <Box alignSelf="center">
              <h1>root</h1>
          </Box>
        <Box >
              <Link to={`/Home/${name}`} >Home</Link>
          </Box>
          <Box >
            <h1>welcome</h1>
            </Box>
        </Box>

      </Grommet>
  );
}

export default App;
